import React from "react";
import { render } from "react-dom";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";

function CustomChart() {
  const condition = Boolean(Math.round(Math.random()));
  const options = {
    series: [
      {
        data: [
          [Date.UTC(2019, 15, 13), 25],
          [Date.UTC(2019, 16, 11), 35],
          [Date.UTC(2019, 17, 11), 40],
          [Date.UTC(2019, 18, 11), 20],
          [Date.UTC(2019, 19, 11), 15],
        ],
      },
    ],
    xAxis: {
      type: "datetime",
      dateTimeLabelFormats: {
        day: condition ? "%e-%b-%y" : "%e%b%y",
        month: condition ? "%b-%y" : "%b '%y",
      },
    },
  };

  return (
    <div>
      <HighchartsReact highcharts={Highcharts} options={options} />
    </div>
  );
}
export default CustomChart;
